import React from "react";
import { CartProvider } from "./context/CartContext";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";

// üìÑ P√°ginas principales
import Home from "./pages/Home";
import Category from "./pages/Category";
import ProductDetail from "./pages/ProductDetail";
import Cart from "./pages/Cart";
import Checkout from "./pages/Checkout";
import Admin from "./pages/Admin";
import Dashboards from "./pages/Dashboards";
import AdminLogin from "./pages/AdminLogin";
import ProtectedRoute from "./components/ProtectedRoute";

// üöÄ Otras secciones
import Impresion3D from "./pages/Impresion3D";
import Robotica from "./pages/Robotica";
import Cursos from "./pages/Cursos";

function App() {
  return (
    <CartProvider>
      <Router>
        <Navbar />
        <main style={{ padding: "20px" }}>
          <Routes>
            {/* üè† Inicio */}
            <Route path="/" element={<Home />} />

            {/* üì¶ Categor√≠as din√°micas */}
            <Route path="/productos/:categoryName" element={<Category />} />
            <Route path="/industria/:categoryName" element={<Category />} />

            {/* üöÄ Otras categor√≠as fijas */}
            <Route path="/impresion3d" element={<Impresion3D />} />
            <Route path="/robotica" element={<Robotica />} />
            <Route path="/cursos" element={<Cursos />} />

            {/* üõí Carrito y Checkout */}
            <Route path="/cart" element={<Cart />} />
            <Route path="/checkout" element={<Checkout />} />

            {/* üì¶ Detalle de producto */}
            <Route path="/producto/:id" element={<ProductDetail />} />

            {/* üîê Admin protegido */}
            <Route
              path="/admin"
              element={
                <ProtectedRoute>
                  <Admin />
                </ProtectedRoute>
              }
            />

            {/* üîì Login de admin */}
            <Route path="/admin-login" element={<AdminLogin />} />

            {/* üìä Dashboards IoT */}
            <Route path="/dashboards" element={<Dashboards />} />
          </Routes>
        </main>
        <Footer />
      </Router>
    </CartProvider>
  );
}

export default App;
